const ItemList = ({ items }) => {
  return (
    <div>
      <h2>상품 목록</h2>
      <ul>
        {items.map(item => (
          <li key={item.id}>
            {item.name} - {item.price}원
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ItemList;
